import React from "react";
import {
  BrowserRouter as Router,
  Route,
  Navigate,
  Routes,
} from "react-router-dom";

import Users from "./users/pages/Users";
import "./App.css";
import Location from "./locations/pages/Location";

const App = () => {
  return (
    <Router>
      <Routes>
        <Route path="/" exact>
          <Users />
        </Route>
        <Route path="/pages/new" exact>
          <Location />
        </Route>
        <Navigate to="/" />
      </Routes>
    </Router>
  );
};

export default App;
